import React, { Component } from 'react'

class navbar extends Component {
    render() {
        return (
            <div>
                <nav className="nav-header">
                    <button className="head-toggle">
                        <i className="fa fa-bars" aria-hidden="true"></i>

                    </button>
                </nav>

            </div>
        )
    }
}
export default navbar
